import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from "./Pages/home/Home";
import Detail from "./Pages/Detail/Detail";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/user:id" element={<Detail />} />
      </Routes>

    </BrowserRouter>
  );
}

export default App;
